import React from 'react';
import ReactDOM from 'react-dom' ;
import './index.css' ;
import Card from './Cards' ;
import Sdata from './Sdata' ;

function ncard(val){
  return (
    <Card 
    imgSrc = {val.imgSrc}
    title =  {Sdata[0].title}
    sname =  {Sdata[0].sname}
    link =   {Sdata[0].link}
    />
  )
}

ReactDOM.render(
  <>
    <h1 className = 'heading_style'> List of top 3 Netflix movies in 2k23</h1>



    Sdata.map(ncard) ;

  </>


  ,document.getElementById('root') 
)
